import React, { useEffect } from 'react';
import './Header.css';
import {NavLink} from 'react-router-dom';
import $ from 'jquery';
const Header = () => {
  function animation(){
    let tabsNewAnim = $('#navbarSupportedContent');
    let activeItemNewAnim = tabsNewAnim.find('.active');
    let activeWidthNewAnimHeight = activeItemNewAnim.innerHeight();
    let activeWidthNewAnimWidth = activeItemNewAnim.innerWidth();
    let itemPosNewAnimTop = activeItemNewAnim.position();
    let itemPosNewAnimLeft = activeItemNewAnim.position();
    $(".hori-selector").css({
      "top":itemPosNewAnimTop.top + "px",
      "left":itemPosNewAnimLeft.left + "px",
      "height": activeWidthNewAnimHeight + "px",
      "width": activeWidthNewAnimWidth + "px"
    });
    $("#navbarSupportedContent".css).on("click","li",function(e){
      $("navbarSupportedContent ul li").removeClass("active");
      $(this).addClass('active');
      let activeWidthNewAnimHeight = $(this).innerHeight();
      let activeWidthNewAnimWidth = $(this).innerWidth();
      let itemPosNewAnimTop = $(this).position();
      let itemPosNewAnimLeft = $(this).position();
      $(".hori-selector").css({
        "top":itemPosNewAnimTop.top + "px",
        "left":itemPosNewAnimLeft.left + "px",
        "height": activeWidthNewAnimHeight + "px",
        "width": activeWidthNewAnimWidth + "px"
      });
    });

    useEffect(()=>{
      animation();
      $(window).on('resize', function(){
        setTimeout(function() {animation();}, 500);
      });
    }, []);
  }
  return (
  <nav className="navbar navbar-expand-lg navbar-mainbg">
    <NavLink className="navbar-brand navbar-logo" to="/" exact>
    Job Portal
    </NavLink>
    <button 
    className="navbar-toggler"
    type="button"
    data-toggle="collapse"
    data-target="#navbarSupportedContent"
    aria-controls="navbarSupportedContent"
    aria-expanded="false"
    aria-label="Toggle navigation">
    <i className="fas fa-bars text-white"> </i>
    </button>
    
    <div className="collapse navbar-collapse" 
    id="navbarSupportedContent">
    <ul className="navbar-nav ml-auto">
      <div className="hoti-selector">
      <div className="left"></div>
      <div className="right"></div>
      </div>

      <li className="nav-item active">
        <NavLink className="nav-link" to="/" exact>
          <i className="fas fa-tachometer-alt">Home</i>
        </NavLink>
      </li>
      <li className="nav-item active">
        <NavLink className="nav-link" to="/about" exact>
          <i className="fas fa-address-book">About</i>
        </NavLink>
      </li>
      <li className="nav-item active">
        <NavLink className="nav-link" to="/contact" exact>
          <i className="fas fa-copy">Contact Us</i>
        </NavLink>
      </li>
      <li className="nav-item active">
        <NavLink className="nav-link" to="/services" exact>
          <i className="fas fa-clone">Services</i>
        </NavLink>
      </li>
      <li className="nav-item active">
        <NavLink className="nav-link" to="/testimonials" exact>
          <i className="fas fa-chart-bar">Testimonials</i>
        </NavLink>
      </li>
    </ul>
    </div>
  </nav>
  )
}

export default Header;
